import React from 'react';
import { Button, Modal } from 'react-bootstrap';
interface props {
    visible : boolean,
    closeModal : ()=>void;
}

function ModalMarket(props:props) {


    return (
        // <div style={{position:'absolute',marginTop: 10,}}>
        //     <>

                <Modal show={props.visible} onHide={props.closeModal} statusBarTranslucent={true}
                       backdropOpacity={0.4}>
                    <Modal.Header closeButton>
                        <Modal.Title>Modal heading</Modal.Title>
                    </Modal.Header>
                    <Modal.Body>Woohoo, you are reading this text in a modal!</Modal.Body>
                    <Modal.Footer>
                        <Button variant="secondary" onClick={props.closeModal}>
                            Close
                        </Button>
                        <Button variant="primary" onClick={props.closeModal}>
                            Save Changes
                        </Button>
                    </Modal.Footer>
                </Modal>
            // </>
        // </div>
    );
}

export default ModalMarket;
